 <p style=text-align:center><span>【新增下架原因】</span><p style=text-align:left><span>新增下拉选项：下架原因分类、允许自动上架、允许覆盖下架原因；都有必填校验</span><p style=text-align:left><span>1.下架原因分类-可选添加的所有分类；单选</span><p style=text-align:left><span>2.允许自动上架</span><ul><li style=text-align:left><span>值为是、否；单选；</span><li style=text-align:left><span>当该下架原因的SKU国内自由库存&amp;gt;0时，该SKU按照自由库存自动上架；</span><li style=text-align:left><span>按照自由库存数量上架SKU；同时该SKU的卖库存字段为卖库存状态</span></ul><p style=text-align:left><span>3.允许覆盖下架原因</span><ul><li style=text-align:left><span>值为是、否；单选；</span><li style=text-align:left><span>先操作过SKU下架，后按照GOODS维度下架，需要将GOODS维度的下架原因覆盖至之前下架的SKU</span></ul><p style=text-align:left><span><br></span></p>

 <div id=u71_text class=text>
 <p style=text-align:center><span>新增【永久下架申请上架】功能</span><ul><li style=text-align:left><span>支持GOODS、SKU维度批量提交；个别提交失败展示提醒，不影响其他值提交成功</span><li style=text-align:left><span>填写完毕，点击【永久下架申请上架】弹出弹窗，需要手动输入上架原因；只允许文本格式输入；有必填校验</span><li style=text-align:left><span>校验1：GOODS、SKU是否存在；</span><li style=text-align:left><span>校验2：GOODS、SKU是否为下架状态</span><li style=text-align:left><span>校验3：GOODS、SKU的下架类型是不是永久下架</span><li style=text-align:left><span>提交成功以后按照SKU维度生成上下架审核界面的待处理数据</span></ul><p style=text-align:center><span><br></span></p>

 </div>

 <ul><li><span>界面名称改为上下架审核</span><li><span>该列表新增数据-永久下架申请上架的数据，该数据需要人工进行审核处理</span><li><span>每日自动审核通过下架1000款goods， 对单个供应商限制30个GOODS，下架类型为暂时缺货的原因下架，自有库存&amp;lt;0的sku直接下架，备注为卖库存下架，处理后，审核员为admin，状态为已处理，结果为下架；自有库存&amp;gt;0的sku处理为拒绝下架，备注为卖库存拒绝，同时是否卖库存填充为是，处理后，审核员为admin，状态为已处理，结果为拒绝下架</span><li><span>上下架审核页面进入时默认待处理状态、其他限制默认放开</span><li><span>sku查询项支持多个id查询 ，用逗号隔开</span></ul>
